const Nav = () => {

    const data = [
        {title:"À propos",value:"about"},
        {title:"Tarifs",value:"tarifs"},
        {title:"Contact",value:"contact"}
    ]


  const handleScroll = (id) => {
    const element = document.getElementById(id);
    element.scrollIntoView({ behavior: "smooth" });
  }


  return (
    <nav className="w-100 d-flex justify-content-around nav ">
        {data.map((item,index)=>(
            <div onClick={() => handleScroll("about")}>A propos</div>
        ))}

      <div onClick={() => handleScroll("tarifs")}>Tarifs</div>
      <div onClick={() => handleScroll("contact")}>Contact</div>
    </nav>
  );
};

export default Nav;
